import Document, {Html} from "next/document";
import Head from "../components/head";

class CustomDocument extends Document {
  render() {
    return (
      <Html>
        <Head />
        <body
          className={"skin-blue sidebar-mini"}
        >
        
        </body>
      </Html>
    );
  }
}

export default CustomDocument;
